import './cart.css'
import { mainapi } from './API'
import { X } from '@phosphor-icons/react'


export class Cart extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         
      }
    }
  render() {
    return (
      <div className='cart-section'>
        <div className='cart-content'>
            <p>x</p>
            <h2> My Cart </h2>
                        {
                            mainapi.map(ps=>{return(
                            <div className='ccard' key={ps.id}>
                                <img src={ps.img} />
                                <div className='ccard-text'>
                                <h3>{ps.title}</h3>
                                <p>Quantity 5</p>
                                <div>
                                    <h3>{ps.price} LE</h3>
                                    <button>Remove</button>
                                </div>
                                </div>
                            </div>
                            )})
                        }
        </div>
      </div>
    )
  }
}

export default Cart
